import { Grid } from "@mui/material";
import * as React from "react";
import BasicCard from "./BasicCard";

function Login() {
  return (
    <div>
      <Grid container>
        <Grid
          xs={12}
          sx={{
            display: "flex",
            flexDirection: "row",
            flexWrap: "wrap",
            justifyContent: "center",
            marginTop: "100px",
          }}
        >
          <div>
            <BasicCard></BasicCard>
          </div>
        </Grid>
      </Grid>
    </div>
  );
}
export default Login;
